/* eslint-disable react/react-in-jsx-scope */
import MainPage from './pages/MainPage';
import { ReactComponent as SunSVG } from './images/sun-svg.svg';
import { ReactComponent as GardeningGrassSVG } from './images/gardening-grass-svg.svg';
import { ReactComponent as CloudSVG } from './images/cloud-svg.svg';

import './App.css';

function App() {
  return (
    <>
      <MainPage key="main-page" />
      <SunSVG className="sun-svg" />
      <GardeningGrassSVG className="gardening-grass-svg" />
      <CloudSVG className="cloud-svg" style={{ top: '30px', left: '50px' }} />
      <CloudSVG
        className="cloud-svg mirror"
        style={{ top: '70px', right: '50px' }}
      />
      <CloudSVG
        className="cloud-svg mirror"
        style={{ top: '130px', left: '200px' }}
      />
      <CloudSVG
        className="cloud-svg"
        style={{ top: '150px', right: '200px' }}
      />
    </>
  );
}

export default App;
